import React from 'react'

import Interests from './interests/Interests'
import Experience from './experiences/Experiences'

import styles from "./Career.module.css";

const career = (props) => {
    return (
        <div id={styles.career}>

            <div id={styles.subsection}>
                <button 
                    id={styles.interests}
                    onClick={props.leftClick}
                >
                    {props.left}
                </button>

                <button 
                    id={styles.experiences}
                    onClick={props.rightClick}
                >
                    {props.right}
                </button> 
            </div>

            <Interests/>
            <Experience/>

        </div>
    )
}

export default career;
